B.Aq=new A.at("Browser audio","Usability improvements","Version 2023.18.1 adds the ability to control the sound settings in the Flutter app. The feature can be disabled if you intend to use Bluetooth Audio or other peripherals.")
B.Bp=new A.at("Virtual touchscreen","Multitouch support","Multitouch support is now available in Tesla Android. The overall stability of the component has been increased.")
B.Ax=new A.at("Android Platform","Boot time optimization","Version 2023.18.1 takes ~2/3x less time to boot when compared to other Android 13 releases.")
B.AQ=new A.at("Android Platform","Support for OTA updates","Version 2023.18.1 adds support for OTA updates. A/B (Seamless) mechanism ensures a safe installation with a rollback to the previous build in case of failure. The process takes place in the background; you can use Tesla Android when the update is being installed.\n\nNavigate to Settings -> System -> Updater to check update availability in the future.\n\nUpdates are not incremental. You can skip a few versions and update directly to the newest build.\n\nOnly online updates are available in this release; connect your Raspberry Pi to your home router with an Ethernet cable to avoid data charges. Each update weighs around 1 GB.")
B.Bb=new A.at("Single image install","Usability improvements","The bootloader has been updated to support the single-image install process better. In addition, the filesystem will now expand to take advantage of the entire SD Card on the first boot(similar to how Raspbian behaves).\n\nAny SD Card over 16GB will work with Tesla Android, but 64GB is recommended.\n\nThe download size has been significantly reduced, and the manual installation procedure has been deprecated and removed from the website. ")
